import React, { Component } from "react";

class ListItem extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      users: []
    };
  }

  render() {
    return (
      <tr>
        <td data-field="name">{this.props.user.Name}</td>
        <td data-field="last-name">LAST NAME</td>
      </tr>
    );
  }
}

export default ListItem;
